  - ('Nachricht an alle {0}', 'Nachricht an alle an {1} {0}')
  - ('Transmitir {0}', 'Transmitir {0} para {1}')
  - ('Trasmetti {0}', 'Trasmetti in {1} {0}')
  - "('actions', 'badge', 'body', 'dir', 'icon', 'image', 'lang', 'renotify',\n  \
    \  'requireInteraction', 'tag', 'timestamp', 'vibrate')"
  - ('broadcast {0}', 'broadcast to {1} {0}')
