  - (HTTPStatus.OK, HTTPStatus.CREATED)
  - (HTTPStatus.OK, HTTPStatus.CREATED, HTTPStatus.ACCEPTED)
  - (IqError, IqTimeout, XMPPError)
  - (ServiceBusConnectionError, MessagingEntityNotFoundError)
  - (SlackApiError, ClientError)
