  - (atch_num, atch_name)
  - (byte_chunk, _)
  - (config.get(CONF_USERNAME), config.get(CONF_API_KEY))
  - (config[CONF_USERNAME], config[CONF_API_KEY])
  - (image, filename)
  - (k, v)
  - (key, item)
  - (key, registration)
  - (key, val)
  - (media_category, media_type)
  - (media_type, _)
  - (nextcord.HTTPException, nextcord.NotFound)
  - (self._host, self._port)
  - (self.username, self.api_key)
  - (smtplib.socket.gaierror, ConnectionRefusedError)
  - (str, Any)
  - (str, MyBMWVehicle)
  - (str, dict[str, Device | Channel])
  - (str, str)
  - (target, result)
  - (ttype, tname)
  - (webhook_id, entry)
  - str, Device | Channel
